import * as React from 'react';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import HomeIcon from '@mui/icons-material/Home';
import SearchIcon from '@mui/icons-material/Search';
import MessageIcon from '@mui/icons-material/Message';
import CompanyName from '../assets/Instagram.png'
import styles from './tabular.module.css'
import { AppBar } from '@mui/material';


const Tabular = () => {
    const handleChange=()=>{}
    const value=""
    return (
        <AppBar>
        <Tabs orientation='vertical' value={value} onChange={handleChange} aria-label="icon label tabs example">

<img className={styles.logo} src={CompanyName} alt="logo" height={80} width={200}/>
          <Tab icon={<HomeIcon />} iconPosition="right" label="Home" />
          <Tab icon={<SearchIcon />} label="Search" />
          <Tab icon={<MessageIcon />} label="Message" />
        </Tabs>
        </AppBar    >
      );
    }


export default Tabular
